import React from 'react';
import { withRouter, Switch } from "react-router-dom";
import PrivateRoute from '../PirvateRoute';
import Auth from './auth/Auth';
import ResetPassword from './auth/ResetPassword';
import Header from './components/Header';
import LeftSidebar from './components/LeftSidebar';

import Footer from './components/Footer';

const RouteAuth = props => {
    return <>
    <Header />
    <div className="container"
        style={{marginTop: "50px"}}
    >
        <LeftSidebar />
        <Switch>
            <PrivateRoute exact path="/auth" component={Auth} />
            <PrivateRoute exact path="/auth/reset-password/:resetCode" component={ResetPassword} />
        </Switch>
        {/* <Route component={Footer} /> */}
    </div>
    <Footer />
</>
}

export default withRouter(RouteAuth);
